import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter } from "react-router-dom"; 
import Home from "./pages/Home";  // make sure it points to your merged Home component
import { HashRouter } from "react-router-dom";

import App from "./App";
import "./index.css";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Home />   {/* Renders your merged Home component instead of App */}
    </BrowserRouter>
  </React.StrictMode>
);
